import React, { Fragment } from "react";
import "../navBar.css";
import NavBarSearch from "./NavBarSearch";
import NavBarBtn from "./NavBarBtn";
import { withRouter } from "react-router-dom";
const NavBarItems = () => {
  return (
    <Fragment>
      <NavBarBtn />
      <NavBarSearch />
    </Fragment>
  );
};
export default withRouter(NavBarItems);
